avoid mongo driver changes dates on a query using builders<p>I have some problems querying, on a net web service, documents from a mongo db (version 3.4.4)</p>

<p>It seems the dates are converted To UniversalTime, I would like avoid that conversion.</p>

<p>For example with this code i want search for documents with date 9 july 2018</p>

<pre><code>MongoClient mongoClient = new    MongoClient("mongodb://xxx");
IMongoDatabase database = mongoClient.GetDatabase("mydb");
IMongoCollection&lt;BsonDocument&gt; collection = database.GetCollection&lt;BsonDocument&gt;("mycollection");

DateTime dateFrom = DateTime.Parse("2018-07-09");
DateTime dateTo = DateTime.Parse("2018-07-10");

var query_filter = Builders&lt;BsonDocument&gt;.Filter.And
(Builders&lt;BsonDocument&gt;.Filter.Gte("utcData", new BsonDateTime(dateFrom)) &amp;
                         Builders&lt;BsonDocument&gt;.Filter.Lte("utcData", new BsonDateTime(dateTo))
                     );

            System.Diagnostics.Debug.Write(query_filter.Render(collection.DocumentSerializer,
                          collection.Settings.SerializerRegistry).ToString());
</code></pre>

<p>but this is the query sent to the server</p>

<pre><code>{ "utcData" : { "$gte" : ISODate("2018-07-08T22:00:00Z"), "$lte" : ISODate("2018-07-09T22:00:00Z") } }
</code></pre>

<p>Why is one day subtracted from dates? Is there a way to avoid any changes on dates?</p>

<p>Thanks.</p>

