Get one element from the array of results by index<p>So every user has 0-3 items in the database. I don't have their indexes, I sort them by creation date, from oldest to youngest. I was wondering if it is possible to get the element from result array by its index by native mongo/mongoose tools. </p>

<p>For example I have these 3 documents in DB for user <code>theguy</code>: </p>

<pre><code>{ "_id" : 1, "name" : "theguy", otherdata: ["data 1", "data 2"] }
{ "_id" : 10, "name" : "theguy", otherdata: ["data 1", "data 2"] }
{ "_id" : 333, "name" : "theguy", otherdata: ["data 1", "data 2"] }
</code></pre>

<p><em><code>_id</code> will be ObjectId</em></p>

<p>Then user will try to get some data. He inputs a number in the range from 1 to 3. There can be 0, 1, 2 or 3 entries in database under his name. The example above displays the situation when user has all 3 entries filled. But user doesn't care about all of them right now, he entered the index, he needs only second result out of these 3. </p>

<p>What works for me right now is this: </p>

<pre><code>//user defined the index
index = 2;
//search all docs by this user, but get only ids
let usrlist = await User.find({"name": name}).distinct('_id');
//based on the ids array we can now request exact second document from the database: 
//usrlist[index-1] or usrlist[1]
let exactusr = await User.findOne({"_id": usrlist[index-1]});
</code></pre>

<p>So the result for <code>exactusr</code> will be: </p>

<pre><code>{ "_id" : 10, "name" : "theguy", otherdata: ["data 1", "data 2"] }
</code></pre>

<p>I try to minimize the load by getting only ids, instead of all 3 documents at once. Now the thing is, well, this doesn't look "nice". Getting an array of <code>_id</code> to create another query based on that doesn't seem optimal. And at the end, I don't even know what is better: to do 2 queries(as above) or do 1 query for all user documents and choose the one user needs by index. Documents may be kind of big, containing up to 12000 characters each.</p>

<p>So looking for native ways I found <code>$slice</code>, but I don't think it works with the result array, or I don't understand how. </p>

<p>My attempt of using <code>$slice</code>: </p>

<pre><code>index = 2;
usr = await User.find({"name": name}, {$slice: [index-1, 1]});
</code></pre>

<p>Result: </p>

<pre><code>[ {"_id" : 1}, {"_id" : 10}, {"_id" : 333} ]
</code></pre>

<p>Expected result: </p>

<pre><code>{ "_id" : 10, "name" : "theguy", otherdata: ["data 1", "data 2"] }
</code></pre>

<p>Any ideas? Or other methods that I could make this work? </p>

