How to filter for "." in MongoDb regex filter?<p>I am trying to run a query against a mongodb database.
The user query is a regular expression in a format similar to perl. I'm translating the user's regex to Mongo filter.</p>

<p>Here is the query code:</p>

<pre><code>private List&lt;string&gt; GetDocuments(string by_regex)
{
    string regex = by_regex.Replace("[", @"\[");
    regex = regex.Replace("]", @"\]");
    regex = regex.Replace("*", ".*");
    regex = "^" + regex + "$";

    var filter = string.Format("{{_id:'CRF^{0}'}}", regex);
    MyObject item = collection.Find(filter).SingleOrDefault(); 
    ....
}
</code></pre>

<p>Invoking the above method with the regular expression <code>*.crc</code> is throwing an exception at the <code>Find</code> statement:</p>

<p><code>Invalid escape sequence in JSON string '\.'.</code></p>

<p>The filter at runtime is <code>{_id:'CRF^^.*\\.crc$'}</code> - so I assume this is something with the <code>.</code> char escaping, but for some reason I can't find the right way to escape it for Mongo to not complaint.</p>

