Can't assign request.payload values in query<p>I'm developing a simple app with Node/Hapi/Mongodb, but running into a strange issue. Below is the route that handles adding/updating scores; when I send some data to this endpoint through Insomnia/Postman it works as expected. However, when this POST is coming from a different app I'm getting strange results; the value is always null for every field (again this only happens when the POST is coming from another site, but I've logged out the request payload and can see that the data is correct, just gets set to null when assigning to an object, or trying to use it a query)</p>

<pre><code>server.route({
    method: 'POST',
    path: '/update-score',
    handler: (request, h) =&gt; {
        var scores = db.collection('scores');

        var updateScore = new Promise((resp, rej) =&gt; {
            console.log('payload ', request.payload);
            scores.findOneAndUpdate({customerID: request.payload.customerID}, {$set: {customerID: request.payload.customerID, customerName: request.payload.customerName, highScore: request.payload.highScore}}, {upsert: true}, (err, res) =&gt; {
                if (err) {
                    return rej(err);
                }
                else {
                    return resp(res);
                }
            })
        });

        return updateScore;
    }
});
</code></pre>

<p>The console logs out the request payload correctly, but its null/undefined when the query tries to use it. I have also tried creating two objects, outside the mongo method call (like below), and after console logging these pre-defined objects out the value was null there as well; even though I can console.log the request.payload after defining these objects and the data is good.</p>

<pre><code>server.route({
    method: 'POST',
    path: '/update-score',
    handler: (request, h) =&gt; {
        var scores = db.collection('scores');

        var queryObj = { 
           customerID: request.payload.customerID
        };

        var updateObj = {
           $set: {
              customerName: request.payload.customerName,
              highScore: request.payload.highScore
           }
        }
        var updateScore = new Promise((resp, rej) =&gt; {
            console.log('again ', request.payload);
            scores.findOneAndUpdate(queryObj, updateObj, {upsert: true}, (err, res) =&gt; {
                if (err) {
                    return rej(err);
                }
                else {
                    return resp(res);
                }
            })
        });

        return updateScore;
    }
});
</code></pre>

