Converting stored MongoDB collection documents from BsonDocument to "MyClass" type?<p>I have the following situation. I have two classes <code>Person</code> and <code>Animal</code></p>

<pre><code>using System;
using MongoDB.Bson;
using MongoDB.Bson.Serialization.Attributes;
namespace MongoTesting.Documents
{
    public class Person
    {
        [BsonId]
        [BsonRepresentation(BsonType.String)]
        public Guid PersonId { get; set; } = Guid.NewGuid();

        public Guid PetId { get; set; } = Guid.Empty;

        public string Name { get; set; } = "Person";
    }
}

using System;
using MongoDB.Bson;
using MongoDB.Bson.Serialization.Attributes;
namespace MongoTesting.Documents
{
    public class Animal
    {
        [BsonId]
        [BsonRepresentation(BsonType.String)]
        public Guid AnimalId { get; set; } = Guid.NewGuid();

        public bool IsMammal { get; set; }

        public string Description { get; set; } = "Animal";
    }
}
</code></pre>

<p>Which were serialized into <code>IMongoCollection</code>s</p>

<pre><code>public IMongoCollection&lt;BsonDocument&gt; PersonCollection { get; set; }
public IMongoCollection&lt;BsonDocument&gt; AnimalCollection { get; set; }
...
PersonCollection = Database.GetCollection&lt;BsonDocument&gt;("PersonCollection");
AnimalCollection = Database.GetCollection&lt;BsonDocument&gt;("AnimalCollection");
</code></pre>

<p>In these collections of type <code>IMongoCollection&lt;BsonDocument&gt;</code> I now have a large amount of documents. </p>

<hr>

<p>I recently have been refactoring my code and queries related to MongoDB. I have found that I can save documents into collections with strongly typed documents, for example I now have the collections</p>

<pre><code>public IMongoCollection&lt;Person&gt; PersonCollection { get; set; }
public IMongoCollection&lt;Animal&gt; AnimalCollection { get; set; }
</code></pre>

<p>On which I can perform cleaner and more meaningful queries easily. </p>

<hr>

<p>As result of these changes and the large amount of documents already stored in my collection I would like to convert the documents in the collection from <code>BsonDocument</code> to <code>Person</code>/<code>Animal</code> documents.</p>

<p><strong>How can I convert stored MongoDB collection documents from <code>BsonDocument</code> to documents of a specific class' type?</strong></p>

