How to send bulk MongoDB count() queries?<p>My application has a search field and to do an autocomplete, I first fetch the <code>distinct()</code> values, and immediately after, I send a <code>count()</code> query for each distinct value. There can be dozens of values to then count, that's a lot of queries.</p>

<p>Any idea how I could avoid this large number of queries using MongoDB's NodeJS module?</p>

<p>For now, the query is as such:</p>

<pre><code>const baseQuery = {
    "organization": organization,
    "status": "processed"
}

let domains = []

// A. Query to get the disinct values
MongoDB.getMainCollection().distinct(`location.hostname`, { organization, status: "processed" })

    // B. Got the value, now creating a COUNT() query for each
    .then(list =&gt; {
        domains = list.map((host,idx) =&gt; Object.assign({}, { domain: host, count: 0, idx: idx }))
        const countingPromises = list.map(host =&gt; MongoDB.getMainCollection().count(Object.assign({}, baseQuery, { "location.hostname": host })))
        return Promise.all(countingPromises)
    })

    // C. Putting it all together
    .then(values =&gt; {

        values.forEach((count, idx) =&gt; {
            const domain = domains.find(d =&gt; d.idx === idx)
            if (domain) {
                domain.count = count
            }
        })

        domains.sort((a,b) =&gt; b.count - a.count)

        resolve(domains)
    })

    .catch(err =&gt; reject(new AppError(`Error listing hostnames for @${organization}.`, 500, err, payload)))
</code></pre>

<p><em>p.s. this works as intended and returns what I want -- just want to avoid so many queries and perhaps bundle them if possible?</em></p>

